def get_mode_complex_array(arr):
    frequency_dict = {}
    for num in arr:
        if num not in frequency_dict:
            frequency_dict[num] += 1
        else:
            frequency_dict[num] = 1
    mode = max(frequency_dict, key=frequency_dict.get)
    return mode

